import React from 'react';
import { makeStyles, Card, CardActions, CardContent, Typography } from '@material-ui/core'

const Login = () => {
  const useStyles = makeStyles({
    root: {
      minWidth: 275,
    },
    bullet: {
      display: 'inline-block',
      margin: '0 2px',
      transform: 'scale(0.8)',
    },
    title: {
      fontSize: 14,
    },
    pos: {
      marginBottom: 12,
    },
  });

  return (
    <div>
      <h1>Login Page</h1>
    </div>
  )
}

export default Login;
